import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the account dropdown
    await page.waitForSelector('.account-lists', { timeout: 5000 });
    await page.click('.account-lists');

    // Wait for the dropdown to appear and click on Your Profile
    await page.waitForSelector('.dropdown-content', { timeout: 5000 });
    await page.click('.dropdown-content a[href="#"]:has-text("Your Profile")');

    // Wait for profile page to load
    await page.waitForSelector('.profile-header', { timeout: 5000 });

    // Verify we're on Jun's profile by checking the name
    const profileName = await page.$eval('.profile-info h2', el => el.textContent.trim());

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile.png'));

    return {
      success: true,
      action: "Navigated to Jun's Profile successfully",
      extractedData: {
        profileName: profileName
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
